import React from 'react'

function Navigation(){
    return (
        <div class="nav">
  <a class="active" href="#home">Home</a>
  <a href="#news">News</a>
  <a href="#contact">Contact</a>
  <a href="#about">About</a>

   </div>
     
    )
}
export default Navigation
